Incidentas vyko pasibaigus LTF taurės rungtynėms sekmadienį, kurias po atkaklios kovos 3:2 laimėjo Klaipėdos „Amber Queen“ tinklininkai. Pastarieji ir žengė į išsvajotąjį turnyro finalo ketvertą. Pasak kauniečių atstovo Valentino Stankevičiaus, tendencingai teisėjavęs G. Vitkus ketvirtame sete visiškai paleido vadžias: „Pradėjo teisėjauti be jokio padorumo. Antrasis teisėjas rodo, kad kažkokia klaida, o jis net nereaguoja, švilpia taip, kaip jam reikia. Išdarkė, sunervino žaidėjus ir trenerę Jolitą Kontvainienę“. Viešosios įstaigos „Kauno tinklinio akademija“ direktorius pasakojo, kad viso nervų karo kulminacija tapo incidentas po rungtynių. „Kai G. Vitkus išlipo iš teisėjavimo bokštelio, Kauno ekipos kapitonas S. Narvydas metė jam repliką. Tuomet teisėjas kaip puolė, kaip davė į žaidėjui krūtinę. Visa laimė, kad Steponas neėmė muštis. Klaipėdiečiai sutramdė teisėją ir aš įsikišau. Visi buvo „apšalę“, trenerė atsisėdo, vos neapalpo“, – įvykių seką dėstė V. Stankevičius, patvirtinęs, kad pirmadienį dėl šio incidento nusiuntęs raštą į federaciją. Pasak jo, jei klaipėdiečiai būtų norėję sąžiningai sužaisti, būtų paskyrę tuos pačius teisėjus, kurie švilpė prieš savaitę tų pačių komandų dvikovoje tik jau Lietuvos čempionate. „Uostamiesčio komanda reklamavosi, kad tai metų rungtynės ir jų tikslas buvo laimėti. G. Vitkus buvo tas asmuo, kuris reikiamu momentu juos traukė. Tai mano nuomonė“, – DELFI kalbėjo „Startas-LSU“ komandos atstovas. V. Stankevičius netgi suabejojo vyriausiojo teisėjo sveikata: „Gal jis psichiškai nesveikas ar apsirūkęs. Nežinau. Neadekvatus buvo. Paprastai žaidėjai būna įaudrinti ir gali pradėti spardyti kamuolius ar iš aikštelės išeiti, bet kai neutralus teisėjas taip elgiasi, tai kažkas nenormalaus“. Incidento vaizdo epizodas nuo 2:09:00: (function(d, s, i, r) {
