tkus visus kaltinimus atrėmė ramiai – žmonės nemoka pralaimėti. Arbitras tikino, kad toks incidentas jam nutiko pirmą kartą per 16-os metų teisėjavimo karjerą. „Kauniečių kapitonas pasibaigus rungtynėms pradėjo rėkti ir kad neužvirstų ant manęs jį atsistūmiau, o jis vėl puola. Tai viską pasako. Man gėda už tokius žaidėjus, provokaciją. Juolab, kad Steponas pats yra teisėjas. Ir dar paskui man sako į veidą: „O kodėl pirmas stūmei“. Aš esu žmogus, man už švilpuko nereikia tampyti“, – kalbėjo jis. Ir tęsė: „Suprantu, visko per rungtynes būna, bet vėliau žmonės prieina, atsiprašo, pakelia ranką, bet ne visus penkis setus ima ir puldinėja teisėją. Taip negalima daryti. Kiekvienas „šūdniekis“ ir bėga aiškintis prie teisėjo, atrodo tuoj nuo bokštelio jį nupurtys“. G. Vitkus pasakojo, kad ir ir prieš savaitę panašūs incidentai buvo, teisėjus kauniečiai taip pat puolė. „Visada pralaimėjusi komanda kaltina teisėją. Tai normalus dalykas. Esu pratęs prie to. Bet kai buvo tokia agresija į teisėją. Man šokas. Nėra taip buvę, – pasakojo klaipėdietis. – Jei netinka teisėjavimas, rašomas protestas, o rungtynių metu prie manęs nebuvo priėjęs nei Kauno komandos kapitonas, nei kas kitas ir neprašė rezervacijos protestui. Buvo tik trenerės nepagarbūs šūksniai nuo suoliuko“, – įspūdžius liejo G. Vitkus ir priminė, kad per visą karjerą neturėjęs nė vieno protesto. Arbitras atskleidė, kad sulaukė ir teisėjų kolegijos pirmininko skambučio, tačiau jam paaiškino, kad taip elgtis, provokuoti ir puldinėti teisėją negalima: „Yra etiketas. Jei mano darbas netinkamas – ramiai pasitraukiu. Man to nereikia, tikrai ne iš to gyvenu. 30 eurų už rungtynes duoda. Pagelbėjau iš bėdos“. Save ramiu žmogumi laikantis G. Vitkus pasakojo, kad jį šokiravo toks svečių ekipos puolimas. Kolegų iš Laikinosios sostinės apie S. Narvydą pasiteiravęs jis išgirdo ne pačių gražiausių žodžių – „tai žmogus, nevaldantis emocijų aikštėje“. „Kauniečių emocijos ten paėmė viršų, įvilko mane į tas emocijas. Esu klaipėdietis, o čia atvažiavęs kažkoks pacanas ima mane tampyti. Taip nebus. Puolimas į veidą, šaukimas, aiškinimai. Apsigraibyk, sakau, Klaipėdoje esi. O jis man vis tiek „matais“. Gėda“, – teigė teisėjas. G. Vitkus sakė, kad kauniečiai gali rašyti, ką nori, bet jam norisi teisybės. „Čia, aišku, ne krepšinis. Krepšinyje už tokius dalykus būtų diskvalifikacija ir piniginės baudos vien suabejojus teisėjo sprendimu, o čia gaunasi visiška košė. Matysime, ką tinklinio federacija darys. Jei tokius dalykus užglaistys ir nuleis, spjausiu į tinklinį“. Lietuvos tinklinio federacijos prezidentas Darius Čerka patvirtino, kad gavo skundą iš pralaimėtojų komandos. „Iš pralaimėtojų dažnai sulaukiame skundų. Šie pralaimėtojai irgi įdomūs – iš pradžių tame skunde minimi visai kiti žmonės, reiškiamos pretenzijos visai kitiems žmonėms. Situacija nagrinėjama“, – teigė jis. Anot LTF prezidento, filmuotą medžiagą analizuojanti teisėjų komisija pirmiausiai priims kažkokią rekomendacinę nuomonę, o vykdomasis komitetas priims sprendimą, kuris veikiausiai bus paskelbtas iki kitos savaitės vidurio.
